import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on Electronics category link
    await page.waitForSelector('a:has-text("Electronics")', { timeout: 5000 });
    await page.click('a:has-text("Electronics")');

    // Wait for navigation to complete and take screenshot
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));

    // Verify we're on the Electronics category page by checking for category-specific content
    const categoryTitle = await page.textContent('h2').catch(() => null);
    const productCards = await page.$$('.product-card');

    return {
      success: true,
      action: "Navigated to Electronics category",
      extractedData: {
        categoryTitle: categoryTitle || 'Not found',
        productCount: productCards.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Electronics category",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
